      // //       <App />
      // //     </PayPalScriptProvider>
      // //   </HelmetProvider>
      // //   </StoreProvider>, // 1st arg
  // document - principal ponto de entrada para modificar o conteudo do HTML
  // document.getElementById('root') //2nd arg
  document.querySelector("#root") //2nd arg
);
